import requests
import base64

from urllib.parse import quote, unquote


def get_params(name):
    params_url = "http://localhost:3000/post/"
    headers = {
        'Accept-Language': "zh-CN,zh;q=0.9,en;q=0.8",
        'Content-Type': "application/x-www-form-urlencoded",
        'Accept-Encoding': 'gzip, deflate, br'
    }
    word = base64.b64encode(name.encode("utf-8"))
    word = quote(word)
    word = unquote(word)
    payload = f"callback=decrypt_data('{word}')"
    response = requests.post(params_url, headers=headers, data=payload)
    return response.json()


def get(name):
    headers = {
        'Accept-Language': "zh-CN,zh;q=0.9,en;q=0.8",
        'Content-Type': "application/x-www-form-urlencoded",
        'Accept-Encoding': 'gzip, deflate, br'
    }
    word = base64.b64encode(name.encode("utf-8"))
    word = quote(word)
    word = unquote(word)
    payload = f"data=decrypt_data({word})"
    url = f"http://127.0.0.1:3000/?{payload}"
    response = requests.get(url, headers=headers)
    print(response.status_code)
    return response.json()


if __name__ == '__main__':
    print(get_params(""))
